import axios from 'axios'

const request = axios.create({
   baseURL: 'https://youtube.googleapis.com/youtube/v3/',
   params: {
      key: 'AIzaSyBMMQ1AEvVOvWhZ0yg8eborOg_vEYoztm4',
   },
})

export default request
